import React from "react";
import { Link } from "react-router-dom";

export default function Login() {
  const [form, setForm] = React.useState({mobile: "", password: ""});
  const [errors, setErrors] = React.useState({});
  const [showPassword, setShowPassword] = React.useState(false);
  const [message, setMessage] = React.useState("");

  const handleChange = (e) => {
    setForm({
      ...form,
      [e.target.name]: e.target.value,
    });
  };

  const validate = () => {
    const newErrors = {};
    if (!form.mobile) newErrors.mobile = "Mobile number is required";
    if (!form.password) newErrors.password = "Password is required";
    return newErrors;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    const validationErrors = validate();
    if (Object.keys(validationErrors).length > 0) {
      setErrors(validationErrors);
    } else {
      setErrors({});
      // Handle form submission logic here
      setMessage("Login successful!");
    }
  };
  const handleCreateAccount = () => {
    // Handle create account logic here
    setMessage("Create account clicked!");
  };  
  const togglePasswordVisibility = () => {
    setShowPassword(!showPassword);
  };
  const handleForgotPassword = () => {
    // Handle forgot password logic here
    setMessage("Forgot password clicked!");
  };
  const handlePrivacyPolicy = () => {
    // Handle privacy policy logic here
    setMessage("Privacy policy clicked!");
  };
  const handleRememberMe = () => {
    // Handle remember me logic here
    setMessage("Remember me clicked!");
  };
  return (
      <>
      <div className="container">
        <div className="row justify-content-center">
          <div className="col-md-6">
            <div className="card">
              <div className="card-body">
                <h2 className="text-center mb-4">Login</h2>
                <form>
                  <div className="mb-3">
                    <label htmlFor="username" 
                            className="form-label">Username
                      </label>
                    <input 
                        type="text" 
                        className="form-control" 
                        id="username" 
                        name="mobile"
                        placeholder="Enter your mobile"
                        onChange={handleChange} />
                  </div>
                  <div className="mb-3">
                    <label htmlFor="password" 
                          className="form-label">Password
                    </label>
                    <input 
                        type="password" 
                        className="form-control" 
                        id="password" 
                        name="password"
                        placeholder="Enter your password"
                        onChange={handleChange}
                         />
                    <button 
                        type="button" 
                        className="btn btn-link p-0 mt-2"
                        onClick={togglePasswordVisibility}>
                      {showPassword ? "Hide Password" : "Show Password"}
                    </button>

                  </div>
                  <div className="mb-3 form-check">
                    <input type="checkbox" className="form-check-input" id="rememberMe" />
                    <label className="form-check-label" htmlFor="rememberMe">Remember me</label>
                  </div>
                  <button 
                      type="submit" 
                      onClick={handleSubmit}
                      className="btn btn-primary w-100"
                      disabled={Object.keys(errors).length > 0}>
                    Login
                  </button>
                </form>
                <div className="text-center mt-3">
                  <a href="#" className="text-decoration-none">Forgot password?</a>
                </div>
                <div className="text-center mt-3">
                  <Link to="/createaccount" className="text-decoration-none">Create an account</Link>
                </div>
                <div className="text-center mt-3">
                  <a href="#" className="text-decoration-none">Privacy Policy</a>
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>

      <style>
        {`
          body {
            background-color: #f8f9fa;
          }

          .card {
            border: none;
            border-radius: 10px;
            box-shadow: 0 4px 6px rgba(0, 0, 0, 0.1);
            margin-top: 50px;
            background-color: #fff;
            margin-bottom: 50px;

          }

          .card-body {
            padding: 40px;
          }

          .btn-primary {
            background-color: #007bff;
            border-color: #007bff;
          }

          .btn-primary:hover {
            background-color: #0056b3;
            border-color: #0056b3;
          }

          .btn-primary:focus {
            box-shadow: 0 0 0 0.2rem rgba(38, 143, 255, 0.5);
          }

        .form-label:hover {
          color: #0056b3;
          cursor: pointer;
        }
        `}
      </style>
</>
  );
}
